import React, { Component } from 'react';
import './styles.scss';
import { getAllprojects } from './../../services/project';

class HomeView extends Component {
  constructor() {
    super();
    this.state = {
      projects: []
    };
  }

  componentDidMount = () => {
    this.fetchData();
  };

  fetchData = () => {
    getAllprojects()
      .then((projects) => {
        this.setState = {
          projects
        };
      })
      .catch((error) => {
        console.log(error);
      });
  };

  render() {
    return (
      <div>
        <h1>This is the Home View</h1>
      </div>
    );
  }
}

export default HomeView;
